import './views.css'
import bg from '../Images/MainBG.png'
import wave from '../Images/wave.png'

const Homepage = () =>{


    return(
        <div className="homepagept0">
        <img src={bg} width="100%" height="100%" alt="mountains with sun shining through" />
        <div className="homepagept1"></div>
        <img className="wave1" src={wave} width="100%" height="15%" alt="waves for adding a nice effect to the the mountains in the background" />
        <img className="wave1" src={wave} width="100%" height="15%" alt="waves for adding a nice effect to the the mountains in the background" />
        <div className="homepagept1"></div>
         </div>
    )
}

export default Homepage;
